import IntegrationInstructionsRoundedIcon from '@mui/icons-material/IntegrationInstructionsRounded';
import DesignServicesRoundedIcon from '@mui/icons-material/DesignServicesRounded';
import HtmlRoundedIcon from '@mui/icons-material/HtmlRounded';
import CssRoundedIcon from '@mui/icons-material/CssRounded';
import JavascriptRoundedIcon from '@mui/icons-material/JavascriptRounded';

export const Services = () => {

    return (
        <div className="p-10 py-20 flex flex-col">
            <div className="text-center pb-2 font-bold">SERVICES</div>

            <div className="grid md:grid-cols-2 gap-4">
                <div className="shadow p-4 hover:shadow-md rounded-md flex flex-col">
                    <IntegrationInstructionsRoundedIcon />
                    <p className='text-blue-300'>Backend Development</p>
                    <div className='flex gap-2'>
                        <JavascriptRoundedIcon />
                        python
                        flask
                        mySQL
                    </div>

                </div>

                <div className="shadow p-4 hover:shadow-md rounded-md flex flex-col">
                    <DesignServicesRoundedIcon />
                    <p className='text-blue-300'>Frontend Development</p>
                    <div className='flex gap-2'>
                        <HtmlRoundedIcon />
                        <CssRoundedIcon />
                        <JavascriptRoundedIcon />
                    </div>
                </div>

                {/* <div className="shadow p-4 hover:shadow-md rounded-md flex flex-col">

                </div> */}
            </div>

            <div className='p-4 shadow'>

            </div>
        </div>
    );
};
